import React from "react";
import "../style/sidebar.css";

function Sidebar() {
  return (
    <div className="sidebar">
      <div className="sidebar-list">
        <span className="icon"></span>
        <span className="text"></span>
      </div>
    </div>
  );
}

export default Sidebar;
